def MotifCaller(motif_function, camera = True):
    delta = pglob.Tabs['motifs']['delta'].get()
    pglob.deletemotif()
    pglob.update()
    motif = globals()[motif_function](delta)
    objects = cmd.get_names('all')
    try:
        if motif != False:
            if type(motif).__name__ != 'dict':
                raise TypeError
            if motif['motif'] not in objects:
                raise Warning
            if cmd.count_atoms(motif['motif']) == 0:
                raise Warning
            if camera:
                pglob.procolor(motif['motif'], show_all='cartoon',color_all='gray')
                if 'extra' in motif:
                    x = motif['extra']
                    xlen = range(len(x))
                    xkeys = x.keys()
                    xvals = x.values()
                    for l in xlen:
                        pglob.procolor(xvals[l],xkeys[l],show_all=None)
                cmd.orient(motif['motif'])
                cmd.deselect()
        else:
            raise Warning
    except TypeError:
        showerror('Type Error','The selected motif returned an incorrect type.'+
            'Expected a Dictionary.')
        return False
    except Warning:
        if camera:
            showinfo('Not Found','The selected motif did not return a result.')
        return False
    else:
        return True

def byResidue(selection, num, numtwo=None,lastselection=None):
    byres = delete = ''
    start, end = 1, num
    if numtwo != None:
        start, end = num, numtwo
    numbers = range(start, end+1)
    for number in numbers:
        if number == end:
            byres = ''.join([byres, 'byres ', selection, "%s"%(number)])
            delete = ''.join([delete, selection, "%s"%(number)])
        else:
            byres = ''.join([byres, 'byres ', selection, "%s"%(number), '&'])
            delete = ''.join([delete, selection, "%s"%(number), '+'])
    cmd.do('select %s, %s'%(selection, byres))
    cmd.do('delete %s'%(delete))
    if lastselection != None:
        cmd.do('set_name %s, %s'%(selection,lastselection))

def P_1n8o_00(delta):
    cmd.do('select asp1, resn asp within %s of resn his'%(delta*3))
    cmd.do('select asp2, resn asp within %s of resn ser'%(delta*7))
    byResidue('asp', 2)
    cmd.do('select his1, resn his within %s of asp'%(delta*4))
    cmd.do('select his2, resn his within %s of resn ser'%(delta*4))
    byResidue('his', 2)
    cmd.do('select ser1, name og within %s of name ne2'%(delta*3.5))
    cmd.do('select ser2, resn ser within %s of asp'%(delta*7))
    byResidue('ser', 2)
    cmd.do('select P_1n8o_00, byres (ser|his|asp)')
    cmd.do('delete ser+his+asp')
    return {'motif':'P_1n8o_00'}

